PRAGMA defer_foreign_keys=TRUE;
CREATE TABLE `fp_posts` (
	`id` text PRIMARY KEY NOT NULL,
	`title` text NOT NULL,
	`creator_id` text NOT NULL,
	`creator_name` text,
	`channel_id` text,
	`channel_title` text,
	`channel_icon_url` text,
	`thumbnail_url` text,
	`has_video` integer DEFAULT false NOT NULL,
	`video_count` integer DEFAULT 0 NOT NULL,
	`video_duration` integer DEFAULT 0 NOT NULL,
	`has_audio` integer DEFAULT false NOT NULL,
	`audio_count` integer DEFAULT 0 NOT NULL,
	`audio_duration` integer DEFAULT 0 NOT NULL,
	`has_picture` integer DEFAULT false NOT NULL,
	`picture_count` integer DEFAULT 0 NOT NULL,
	`is_featured` integer DEFAULT false NOT NULL,
	`has_gallery` integer DEFAULT false NOT NULL,
	`gallery_count` integer DEFAULT 0 NOT NULL,
	`release_date` text,
	`created_at` text DEFAULT (datetime('now')) NOT NULL,
	`updated_at` text DEFAULT (datetime('now')) NOT NULL
);
CREATE TABLE `playlists` (
	`id` text PRIMARY KEY NOT NULL,
	`floatplane_user_id` text NOT NULL,
	`name` text NOT NULL,
	`is_watch_later` integer DEFAULT false NOT NULL,
	`video_ids` text DEFAULT '' NOT NULL,
	`created_at` text DEFAULT (datetime('now')) NOT NULL,
	`updated_at` text DEFAULT (datetime('now')) NOT NULL,
	FOREIGN KEY (`floatplane_user_id`) REFERENCES `users`(`floatplane_user_id`) ON UPDATE no action ON DELETE cascade
);
CREATE TABLE `qr_sessions` (
	`id` text PRIMARY KEY NOT NULL,
	`device_info` text,
	`floatplane_user_id` text,
	`sails_sid` text,
	`api_key` text,
	`status` text DEFAULT 'pending' NOT NULL,
	`expires_at` text NOT NULL,
	`created_at` text DEFAULT (datetime('now')) NOT NULL,
	`completed_at` text
);
CREATE TABLE `users` (
	`floatplane_user_id` text PRIMARY KEY NOT NULL,
	`api_key` text NOT NULL,
	`created_at` text DEFAULT (datetime('now')) NOT NULL,
	`last_accessed_at` text DEFAULT (datetime('now')) NOT NULL
);
CREATE TABLE d1_migrations(
		id         INTEGER PRIMARY KEY AUTOINCREMENT,
		name       TEXT UNIQUE,
		applied_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP NOT NULL
);
CREATE TABLE `device_sessions` (
	`id` text PRIMARY KEY NOT NULL,
	`floatplane_user_id` text NOT NULL,
	`api_key` text NOT NULL,
	`dpop_jkt` text NOT NULL,
	`device_info` text,
	`created_at` text DEFAULT (datetime('now')) NOT NULL,
	`last_accessed_at` text DEFAULT (datetime('now')) NOT NULL,
	FOREIGN KEY (`floatplane_user_id`) REFERENCES `users`(`floatplane_user_id`) ON UPDATE no action ON DELETE cascade
);
DELETE FROM sqlite_sequence;
CREATE INDEX `fp_posts_title_idx` ON `fp_posts` (`title`);
CREATE INDEX `fp_posts_creator_id_idx` ON `fp_posts` (`creator_id`);
CREATE INDEX `fp_posts_release_date_idx` ON `fp_posts` (`release_date`);
CREATE INDEX `playlists_user_id_idx` ON `playlists` (`floatplane_user_id`);
CREATE INDEX `qr_sessions_user_id_idx` ON `qr_sessions` (`floatplane_user_id`);
CREATE INDEX `qr_sessions_expires_at_idx` ON `qr_sessions` (`expires_at`);
CREATE UNIQUE INDEX `users_api_key_unique` ON `users` (`api_key`);
CREATE UNIQUE INDEX `device_sessions_api_key_unique` ON `device_sessions` (`api_key`);
CREATE UNIQUE INDEX `device_sessions_dpop_jkt_unique` ON `device_sessions` (`dpop_jkt`);
CREATE INDEX `device_sessions_user_id_idx` ON `device_sessions` (`floatplane_user_id`);
CREATE INDEX `device_sessions_jkt_idx` ON `device_sessions` (`dpop_jkt`);
